var maximumGain2 = function (s, x, y) {
  let x1Max = 0
  let x2Max = 0

  let temS1 = s
  let temS2 = s

  while (temS1.includes('ba')) {
    temS1 = temS1.replace('ba', '')
    x1Max += y
  }
  while (temS1.includes('ab')) {
    temS1 = temS1.replace('ab', '')
    x1Max += x
  }

  while (temS2.includes('ab')) {
    temS2 = temS2.replace('ab', '')
    x2Max += x
  }
  while (temS2.includes('ba')) {
    temS2 = temS2.replace('ba', '')
    x2Max += y
  }

  return Math.max(x1Max, x2Max)
}

var maximumGain = function (s, x, y) {
  function removePairs(pair, score) {
    let res = 0
    const stack = []
    for (let i = 0; i < s.length; i++) {
      if (
        pair[1] === s[i] &&
        stack.length &&
        stack[stack.length - 1] === pair[0]
      ) {
        stack.pop()
        res += score
      } else {
        stack.push(s[i])
      }
    }
    s = stack.join('')
    return res
  }
  let pair = ['a', 'b']
  if (y > x) {
    pair = ['b', 'a']
  }
  let res = 0
  res += removePairs(pair, Math.max(x, y))
  res += removePairs(pair.reverse(), Math.min(x, y))
  return res
}
